      var pixelToPoint = 0.75;
      const doc = new jsPDF('landscape', 'pt');

      function createPDF(data) {
          const doc = new jsPDF('landscape', 'pt');
          doc.addImage(image, 'JPEG', 0, 0, 842, 595.4);
          doc.text(getPointValue(400), getPointValue(400), data.name.toString());
          doc.text(getPointValue(450), getPointValue(472), (data.class.toString() + ' ' + data.section.toString()));
          doc.text(getPointValue(320), getPointValue(548), data.position.toString());
          doc.text(getPointValue(600), getPointValue(548), data.event.toString());

          doc.save('certificate.pdf');
      }

      function getPointValue(value) {
          return value * pixelToPoint;
      }